(71, 'Armagedon', 'xgcrvs@mail.ru', 4242, NULL, '2017-05-23 00:22:08', '2017-07-08 10:10:38', 'comptmp.png', '<p>Наши спец<strong>иалисты получают от&nbsp;₽40 до&nbsp;₽150 тысяч (и&nbsp;выше). Правильный подход&nbsp;&mdash; это чётко понимать,</strong> какой доход приносит компании конкретный сотрудник, и, в&nbsp;зависимости от&nbsp;этого, выстраивать <em>его уровень заработной платы. У&nbsp;нас в&nbsp;агентстве применяется ряд премий для сотрудников, зависящих от&nbsp;личного вклада сотрудника в&nbsp;прибыль компании, т.&nbsp;е. выполнения его личного KPI. Также есть ряд премий по&nbsp;команде, в&nbsp;которой работает сотрудник, и&nbsp;по&nbsp;агентству в&nbsp;целом для мотивации сотрудников на&nbsp;командную работу.http://localhost:8000/vacancy/70</em></p>\r\n\r\n<p>Наши специалисты получают от&nbsp;₽40 до&nbsp;₽150 тысяч (и&nbsp;выше). Правильный подход&nbsp;&mdash; это чётко понимать, какой доход приносит компании конкретный сотрудник, и, в&nbsp;зависимости от&nbsp;этого, выстраивать его уровень заработной платы. У&nbsp;нас в&nbsp;агентстве</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>применяется ряд премий для сотрудников, зависящих от&nbsp;личного вклада сотрудника в&nbsp;прибыль компании, т.&nbsp;е. выполнения его личного KPI. Также есть ряд премий по&nbsp;команде, в&nbsp;которой работает сотрудник, и&nbsp;по&nbsp;агентству в&nbsp;целом для мотивации сотрудников на&nbsp;командную работу</li>\r\n</ul>\r\n', 'RRM', 'http://localhost:8000/company/create', '3333333333', 2, 2),
(73, 'Компания700', 'xgcrvs@mail.ru', 4242, NULL, '2017-05-23 02:46:11', '2017-08-15 11:17:31', '1502795851-7.jpg', '<p>Иногда мы&nbsp;можем по&nbsp;10&nbsp;раз пересматривать любимый фильм и&nbsp;не&nbsp;замечать какую-то маленькую деталь. А&nbsp;бывает и&nbsp;так, что от&nbsp;зрительского внимания ускользают и&nbsp;сами актеры, которые появляются в&nbsp;кадре мельком или под тонной грима, за&nbsp;которым их&nbsp;просто невозможно узнать.&lt;script&gt;alert(&quot;dsd&quot;);&lt;/script&gt;</p>\r\n\r\n<p>Мы&nbsp;в&nbsp;<strong>AdMe.ru&nbsp;</strong>составили список из&nbsp;14&nbsp;знаменитостей, которых вы&nbsp;точно не&nbsp;замечали при просмотре известных фильмов.</p>\r\n', 'УКВ', 'http://localhost:8000/company/<script>alert(\"dsd\");</script>', '3333333333', 2, 1),
