INSERT INTO `news` (`id`, `name`, `description`, `img`, `created_at`, `updated_at`, `published`) VALUES
(1, 'Давайте розглянемо, які погляди формують нашу концепцію навчання програмуванню', '<p><strong>Практично 100% працевлаштованих за спеціальністю випускників — чому Вінницька ІТ-Академія має такий успіх? Чому наші випускники настільки добре відповідають вимогам провідних ІТ-компаній?</strong></p>\r\n\r\n<p><strong>Звісно, цей успіх має багато складових. Однією з них  є “основа основ”, загальна концепція Академії, підхід до навчання наших студентів. В чому вона полягає? Чим особлива навчальна програма Вінницької ІТ-Академії? Давайте розглянемо, які погляди формують нашу концепцію навчання програмуванню.</strong></p>\r\n', 'Not picture', '2017-05-23 02:21:31', '2017-06-17 14:33:10', 1),
(2, 'Давайте розглянемо, які погляди формують нашу концепцію навчання програмуванню', '<p><strong>Зараз не злічити курсів, які вивчають якусь одну мову програмування “з нуля”. Роки досвіду у навчанні програмістів дозволяють нам впевнено заявляти: такий підхід не є ефективним. Далеко не всі мови програмування підходять на роль першої мови. Деякі мови програмування, як, приміром, Python, мають чудовий інструментарій для вирішення завдань, але зовсім не підходять для навчання програмуванню, оскільки вони використовують досить високі рівні абстракції. Це ніби навчати множенню людину, яка не знає додавання. Можна навчити правильно множити, але людина не буде розуміти суті того, що робить. Тому для найкращих результатів потрібно починати вивчати програмування із низькорівневих мов. В ІТ-Академії навчання починається із вивчення мови C (читається: Сі). Ця мова не тільки тримається на високих позиціях у рейтингах мов програмування, але й чудово підходить в якості першої мови програмування. В процесі вивчення С студенти розбирають основні алгоритми і отримують неоціненну базу знань, яка в подальшому допомагає засвоїти практично будь-яку мову програмування.</strong></p>\r\n', 'Not picture', '2017-05-23 02:22:28', '2017-06-17 14:33:26', 1),
(3, 'Новости не так новости как просто вот', '<p><strong>Зараз не злічити курсів, які вивчають якусь одну мову програмування “з нуля”. Роки досвіду у навчанні програмістів дозволяють нам впевнено заявляти: такий підхід не є ефективним. Далеко не всі мови програмування підходять на роль першої мови. Деякі мови програмування, як, приміром, Python, мають чудовий інструментарій для вирішення завдань, але зовсім не підходять для навчання програмуванню, оскільки вони використовують досить високі рівні абстракції. Це ніби навчати множенню людину, яка не знає додавання. Можна навчити правильно множити, але людина не буде розуміти суті того, що робить. Тому для найкращих результатів потрібно починати вивчати програмування із низькорівневих мов. В ІТ-Академії навчання починається із вивчення мови C (читається: Сі). Ця мова не тільки тримається на високих позиціях у рейтингах мов програмування, але й чудово підходить в якості першої мови програмування. В процесі вивчення С студенти розбирають основні алгоритми і отримують неоціненну базу знань, яка в подальшому допомагає засвоїти практично будь-яку мову програмування.</strong></p>\r\n', 'Not picture', '2017-05-23 02:23:06', '2017-06-17 14:34:12', 1),
(4, 'В процесі вивчення С студенти розбирають основні алгоритми і отримують неоціненну базу знань', '<p><strong>Зараз не злічити курсів, які вивчають якусь одну мову програмування “з нуля”. Роки досвіду у навчанні програмістів дозволяють нам впевнено заявляти: такий підхід не є ефективним. Далеко не всі мови програмування підходять на роль першої мови. Деякі мови програмування, як, приміром, Python, мають чудовий інструментарій для вирішення завдань, але зовсім не підходять для навчання програмуванню, оскільки вони використовують досить високі рівні абстракції. Це ніби навчати множенню людину, яка не знає додавання. Можна навчити правильно множити, але людина не буде розуміти суті того, що робить. Тому для найкращих результатів потрібно починати вивчати програмування із низькорівневих мов. В ІТ-Академії навчання починається із вивчення мови C (читається: Сі). Ця мова не тільки тримається на високих позиціях у рейтингах мов програмування, але й чудово підходить в якості першої мови програмування. В процесі вивчення С студенти розбирають основні алгоритми і отримують неоціненну базу знань, яка в подальшому допомагає засвоїти практично будь-яку мову програмування.</strong></p>\r\n', 'Not picture', '2017-05-23 02:23:43', '2017-06-17 14:34:53', 1),
