(1, 6, 'Roman Melnyk', '', 'romcom77@gmail.com', 'Директор', '3', '1', 60000, '<p>Можу керувати...</p>\r\n', '2016-04-16 14:02:04', '2016-10-03 10:04:48', 1000000, 1, 0, 1, ''),
(2, 8, 'Morgunov Igor', '0637029948', 'morgunov.igor1990@gmail.com', 'Веб розробник', '2', '1', 8000, '<h4>Освіта : </h4>\r\n<h5>2016р. Школа програмістів RIA.com 2016<br />\r\n2015-2016 рр. Вінницька ІТ-Академія<br />\r\n2012-2013 рр. Програма підвищення рівня транспортної дисципліни серед військовослужбовців<br />\r\n2007-2012 рр. денна форма навчання у Вінницькому національно-технічному Університеті, на факультеті радіотехніки та телекомунікацій за спеціальністю «Радіотехніка»  <br />\r\n2005-2007 рр, Фізико - Математична школа Інституту Довузівської підготовки ВНТУ<br />\r\n	</h5>\r\n<h4>Досвід роботи : </h4> <h5>\r\nWeb-проект для RIA.com(створення додаткового сайту RIA.carrier.com з можливістю адміністрування контенту,проходе стадію Альфа тестування) <br /><br />\r\nWeb-проект Робота Молоді - створення пошуку,створення та реалізація логіки роботи зі спеціалізаціями, валідація вхідних даних, пошук та усунення багів)<br />\r\n<a href=\"http://www.robotamolodi.org/\">http://www.robotamolodi.org/</a> <br /><br />\r\nWeb-проект INTITA – створення підсистеми моніторингу юзерів та викладачів,  пошук та усунення багів<br />\r\n<a href=\"http://intita.com/\">http://intita.com/</a> <br /><br />\r\nПроект \"Blocks\" на мові C/C++(гра на логіку з використанням графічної бібліотеки Allegro)<br /><br />\r\nСтажування на СБІ (Програмування МК на мові Ассемблер,пристрій для автоматичного керування рівнем заряду акумулятора під час зарядки) <br /><br />\r\nПАТ «Укртелеком»(вул..Соборна буд. 10)<br /><br />\r\nПАТ «Укртелеком»(вул..Збишко буд. 6) <br />\r\n</h5>\r\n<h4>Навички та вміння :</h4><h5>   \r\n- PHP,JS,C,C++,Java, Assembler,HTML,CSS,NodeJS,SQL<br />\r\n- обізнаний з роботою на: Linux, MySQL, Eclipse, Atom, QT, NetBeans, IntelliJ IDEA, XAMPP, OpenServer, Nginx, PHP Storm,Web Storm, Visual Studio, GIT, SVN, Rapid, ElasticSearch, Rabbit MQ ,KoaJS <br />\r\n</h5>\r\n<h4>Додаткові відомості :</h4><h5>\r\n-водійське посвідчення категорії А,В<br />\r\n-порядний, стресостійкий, комунікабельний, вимогливий до себе та підлеглих, відповідальний;<br /></h5>\r\n', '2016-04-16 15:30:38', '2016-04-16 16:02:52', 20000, 1, 0, 1, ''),
